package main

import (
	"strings"
	"time"
	"bytes"
	"compress/gzip"
	"fmt"
	"io"
	"log"
	"math/rand"
)

func main(){
	generate("Friday")
}

func generate(day string){
	wordSeqs := getWords()
	words := strings.Split(wordSeqs,"\n")

	wordMap := make(map[string][]string)
	for _,w := range words{
		if len(w)==0{
			continue
		}
		letter := string(w[0])
		wordMap[letter] = append(wordMap[letter],w)
	}
	generator(day,wordMap)
}


func generator(day string,wordMap map[string][]string){
	rand.Seed(time.Now().UnixNano())
	day = strings.ToLower(string(day[0]))
	if _,ok := wordMap[day];!ok {
		panic("improper day word")
	}
	wordList := wordMap[day]
	n := rand.Intn(len(wordList))
	fmt.Println(wordList[n])
}

func getWords()string {
	gz, err := gzip.NewReader(bytes.NewBuffer(_words))
	if err != nil {
		log.Fatal("could not read", err)
	}
	defer gz.Close()
	var buf bytes.Buffer
	_, err = io.Copy(&buf, gz)
	if err != nil {
		panic("could not copy" + err.Error())
	}
	return buf.String()
}

